import './App.css';
import DateTime from './componants/date-time/DateTime';
import Covid from './componants/covid-updates/Covid';


function App() {
  return (
    <>
      <DateTime />
      <div className="text-center">
        <h1>Covid-19 updated data</h1>
        <br />
        <br />
        <Covid />
      </div>
    </>
  );
}

export default App;
